export const addTabHistory = (tabData) =>
{
    console.log('this i stabsHIstory',tabData)
    return { 
        type:'ADDTABHISTORY',
        payload:tabData
    }
}

export const addCurrentTabId = (currentTab) =>
{
    console.log('this is current tab',currentTab)
    return { 
        type:'ADDCURRENTTAB',
        current:currentTab
    }
}
